import { Card, Badge, Container, Row, Table, Col } from 'react-bootstrap';

export default function Header() {
  return (
    <Container fluid>
      <Row>
        <Col><img alt="icon" src="../uf.png" width="60" height="60" /></Col>
        <Col xs={11}><h2>FLORIDA TRAFFIC CRASHES DASHBOARD</h2></Col>
      </Row>
    </Container>
  );
}
